{
	"openapi": "3.0.1",
	"servers": [
		{
			"description": "API de histograma discriminado de pedido de material em Projeto",
			"url": "{{host}}/api/construction-projects/v1",
			"variables": {
				"serverUrl": {
					"default": "localhost"
				},
				"serverHttpPort": {
					"default": "8052"
				}
			}
		}
	],
	"info": {
		"description": "API para consulta de histograma agrupada para pedido de material em Projeto.",
		"version": "1.000",
		"title": "Histograma discriminado de pedido de material em Projeto",
		"contact": {
			"name": "Portal TOTVS | INTEGRATION",
			"url": "http://api.totvs.com.br",
			"email": "comiteintegracao@totvs.com.br"
		},
		"x-totvs": {
			"messageDocumentation": {
				"name": "DiscriminatedHistograms",
				"description": "Histograma discriminado de pedido de material em projeto.",
				"segment": "Construção e Projetos"
			},
			"productInformation": [
				{
					"product": "RM",
					"contact": "tribecp.squad.top.ce@totvs.com.br",
					"description": "Consulta de histograma discriminado de pedido de material.",
					"adapter": "",
					"helpUrl": ""
				}
			]
		}
	},
	"paths": {
		"/grouped-histograms": {
			"get": {
				"tags": [
					"DiscriminatedHistograms"
				],
				"summary": "Histograma discriminado de um pedido de material em projeto.",
				"description": "Retorna o histograma discriminado de um pedido de material um projeto.",
				"operationId": "GetAll",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo está disponível com todos os parâmetros.",
							"minimalVersion": "12.1.23"
						}
					]
				},
				"parameters": [
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Order"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Page"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/PageSize"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Fields"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					},
					{
						"name": "companyId",
						"in": "query",
						"description": "Identificador da empresa",
						"required": true,
						"schema": {
							"type": "integer"
						}
					},
					{
						"name": "projectId",
						"in": "query",
						"description": "Identificador do projeto",
						"required": true,
						"schema": {
							"type": "integer"
						}
					},
					{
						"name": "requestId",
						"in": "query",
						"description": "Identificador do pedido de material",
						"required": true,
						"schema": {
							"type": "integer"
						}
					}
				],
				"responses": {
					"200": {
						"description": "Operação realizada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/DiscriminatedHistograms_1_000.json#/definitions/PagedDiscriminatedHistograms"
								}
							}
						}
					},
					"400": {
						"description": "Erro na busca do histograma discriminado",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		}
	},
	"components": {
		"parameters": {},
		"schemas": {}
	}
}
